function Install-WinPCap 
{
    #Copyright (c) 1999 - 2005 NetGroup, Politecnico di Torino (Italy).
    #Copyright (c) 2005 - 2010 CACE Technologies, Davis (California).
    #All rights reserved.
    #For the full winpcap license, please see the repo
    
    #Fill these in with the binaries from a winpcap installation. For more info, see my writeup.
    #TODO: Add x86 support
    $packetdll_x64 = ""
    $wpcapdll_x64 = ""
    $npfsys_x64 = ""
    $pthreadvcdll = ""

    #Drop them to their proper locations on disk
    $packetdll_drop = [System.Convert]::FromBase64String($packetdll_x64)
    [System.IO.File]::WriteAllBytes("c:\windows\system32\packet.dll",$packetdll_drop)

    $wpcapdll_drop = [System.Convert]::FromBase64String($wpcapdll_x64)
    [System.IO.File]::WriteAllBytes("c:\windows\system32\wpcap.dll",$wpcapdll_drop)

    $pthreadvcdll_drop = [System.Convert]::FromBase64String($pthreadvcdll)
    [System.IO.File]::WriteAllBytes("c:\windows\system32\pthreadvc.dll",$pthreadvcdll_drop)

    $npfsys_drop = [System.Convert]::FromBase64String($npfsys_x64)
    [System.IO.File]::WriteAllBytes("c:\windows\system32\drivers\npf.sys",$npfsys_drop)

    #need to convert this into WMI
    #TODO: Remove sc.exe dependence using reflection
    sc.exe create npf binPath= system32\drivers\npf.sys type= kernel start= auto error= normal tag= no DisplayName= "NetGroup Packet Filter Driver"
    sc.exe start npf

}

function Remove-WinPCap 
{
    #TODO: Remove sc.exe dependency
    sc.exe stop npf
    Start-Sleep -s 2
    sc.exe delete npf
    Remove-Item -Force C:\Windows\System32\Packet.dll
    Remove-Item -Force C:\Windows\System32\wpcap.dll
    Remove-Item -Force C:\Windows\System32\pthreadVC.dll
    Remove-Item -Force C:\Windows\System32\Drivers\npf.sys

}

function Get-PacketCapture
{
    [CmdletBinding()]
    Param(
    [Parameter(Mandatory=$False,Position=1)]
    [String]$DevicePattern = "*Local*",
    [Parameter(Mandatory=$True,Position=2)]
    [ValidateScript({$(Split-Path $_ | Test-Path) -and -Not $(Test-Path $_)})]
    [String]$Path,
    [Parameter(Mandatory=$False,Position=3)]
    [String]$Filter="",
    [Parameter(Mandatory=$False,Position=4)]
    [int]$MaxSize=1MB,
    [Parameter(Mandatory=$False,Position=5)]
    [System.TimeSpan]$CaptureTimeout=$(New-Timespan -Seconds 5)
    )

    #Required .NET assemblies
    #TODO: Add license and details for these assemblies
    $PacketDotNet_Assembly = ""
    $SharpPCap_Assembly = ""
    $PacketDotNet_Bytes = [System.Convert]::FromBase64String($PacketDotNet_Assembly)
    $SharpPCap_Bytes = [System.Convert]::FromBase64String($SharpPCap_Assembly)
    [System.Reflection.Assembly]::Load($PacketDotNet_Bytes) | Out-Null
    [System.Reflection.Assembly]::Load($SharpPCap_Bytes) | Out-Null

    #Update types to prevent crashing... thank you Joel Bennet http://poshcode.org/5374
    # To avoid crashing, you MUST avoid accessing the NonBlockingMode property
    # But I also want to expose the Interface.FriendlyName because it's the meaningful name
    Update-TypeData -TypeName SharpPcap.WinPcap.WinPcapDevice -MemberName FriendlyName -MemberType ScriptProperty -Value { $this.Interface.FriendlyName } 
    Update-TypeData -TypeName SharpPcap.WinPcap.WinPcapDevice -DefaultDisplayProperty FriendlyName -DefaultDisplayPropertySet FriendlyName, Addresses, Description, MacAddress  
    # The MacAddress property doesn't seem to work right now, but Interface.MacAddress does
    Update-TypeData -TypeName SharpPcap.WinPcap.WinPcapDevice -MemberName MacAddress -MemberType ScriptProperty -Value { $this.Interface.MacAddress } -Force
    # By default, PcapAddress ToString() shows the address and netmask etc. which we don't need to see all the time.
    #Update-TypeData -TypeName SharpPcap.LibPcap.PcapAddress -DefaultDisplayProperty Addr -MemberName ToString -MemberType ScriptMethod -Value { $this.Addr.ToString() } -Force 


    $Device = [SharpPcap.CaptureDeviceList]::Instance | ?{$_.FriendlyName -like $DevicePattern}

    Write-Verbose "Using Device `"$($Device.FriendlyName)`""
    $Pcap_Writer=  New-Object -TypeName SharpPcap.LibPcap.CaptureFileWriterDevice -ArgumentList ($Path)
    $Pcap_writer.Open()
    Write-Verbose "Opened Dump file `"$Path`""

    $Device.Open([SharpPcap.DeviceMode]::Promiscuous,1000);
    $Device.Filter = $Filter
    $StartTime = Get-Date
    Write-Verbose "Starting Capture at $StartTime"
    Write-Verbose "Capture will terminate at $($StartTime.Add($CaptureTimeout)) or at size $MaxSize"
    while($true)
    {
        if($packet = $Device.GetNextPacket())
        {
            $Pcap_Writer.Write($packet)
        
        }
        if ((Get-ChildItem $Path).length -gt $MaxSize)
        {
            Write-Verbose "Terminating Capture: Size Limit reached"
            break
        }
        if ((New-Timespan $StartTime $(Get-Date)) -gt $CaptureTimeout)
        {
            Write-Verbose "Terminating Capture: Time limit reached"
            break
        }
    }
    $Device.StopCapture()
    $Device.Close()
    $Pcap_Writer.StopCapture()
    $Pcap_Writer.Close()
    
	$OutFile = Get-ChildItem -path $Path 
	return $OutFile
}
